import React, { Component } from 'react'

export class MusicFeed extends Component {

  state = {
    music: []
  }

  componentDidMount() {
    axios.get('http://127.0.0.1:8000/api/song/')
      .then(res => {
        this.setState({
          music: res.data
        });
        console.log(res.data)
      })
  };

  render() {
    return (
      <div>

      </div>
    )
  }
}

export default MusicFeed
